import React from 'react'
import {
    View,
    Text,
    StyleSheet,
    Image,
    TouchableOpacity
} from 'react-native'

const ProductItem = () => {
    return (
        <TouchableOpacity style={styles.container}>
            <View style={styles.Image_pro}>
                <Text>Ashutosh</Text>
            </View>
            <View>
                <Text>this is product item area</Text>
            </View>
        </TouchableOpacity>
    )
}

export default ProductItem

const styles = StyleSheet.create({
    container: {
        flexWrap : "wrap",
        marginLeft : -5,
        marginRight : -5,
        justifyContent: "center",
        height: 250,
        width : 150,
        marginHorizontal : 8,
        marginTop: 5,
        zIndex : 1
    },

    Image_pro : {
        flex : 1,
        justifyContent : "center",
        borderRadius : 10,
        backgroundColor : "lightblue"
    }
})
